import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Layout from './components/Layout';
import Dashboard from './pages/Dashboard';
import Descriptive from './pages/Descriptive';
import Diagnostic from './pages/Diagnostic';
import Predictive from './pages/Predictive';
import Prescriptive from './pages/Prescriptive';
import AnalyticsSuite from './pages/AnalyticsSuite';
import Guide from './pages/Guide';
import Register from './pages/Register';
import Reports from './pages/Reports';

import Login from './pages/Login';
import ReactiveCursor from './components/ReactiveCursor';

import ProtectedRoute from './components/ProtectedRoute';
import { MarketProvider } from './context/MarketContext';
import { ThemeProvider, createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1a237e', // Deep Navy
    },
    secondary: {
      main: '#b71c1c', // Deep Red
    },
    background: {
      default: '#f4f6f8',
      paper: '#ffffff',
    },
    text: {
      primary: '#1A1A1B', // Very Dark Grey/Black
      secondary: '#454546', // Dark Grey
    },
  },
  typography: {
    fontFamily: '"Inter", "Roboto", "Helvetica", "Arial", sans-serif',
    h4: {
      fontWeight: 800,
      color: '#1A1A1B',
    },
    h6: {
      fontWeight: 700,
      color: '#1A1A1B',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <MarketProvider>
        <BrowserRouter>
          <ReactiveCursor />
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />

            {/* Protected Routes */}
            <Route element={<ProtectedRoute />}>
              <Route path="/" element={<Layout />}>
                <Route index element={<Dashboard />} />
                <Route path="descriptive" element={<Descriptive />} />
                <Route path="diagnostic" element={<Diagnostic />} />
                <Route path="predictive" element={<Predictive />} />
                <Route path="prescriptive" element={<Prescriptive />} />
                <Route path="analytics-suite" element={<AnalyticsSuite />} />
                <Route path="reports" element={<Reports />} />
                <Route path="guide" element={<Guide />} />
                <Route path="*" element={<Dashboard />} />
              </Route>
            </Route>
          </Routes>
        </BrowserRouter>
      </MarketProvider>
    </ThemeProvider>
  );
}

export default App;
